import React from "react";
import ReactFlow, {
  MiniMap,
  Controls,
  Background,
} from "reactflow";
import "reactflow/dist/style.css";

// --- Custom Node Styles ---
const nodeStyles = {
  main: { background: "#1E90FF", color: "#fff", borderRadius: "6px", padding: 10 },
  field: { background: "#333", color: "#fff", borderRadius: "25px", padding: "8px 20px" },
  bucket: { background: "#009688", color: "#fff", borderRadius: "8px", padding: 10 },
  dependent: { background: "#9C27B0", color: "#fff", borderRadius: "6px", padding: 10 },
};

// --- Nodes ---
const nodes = [
  {
    id: "DomainHourly",
    type: "default",
    data: { label: "DomainHourly\nMain Report" },
    position: { x: 400, y: 50 },
    style: nodeStyles.main,
  },
  { id: "advertiserId", data: { label: "advertiserId\nType: long" }, position: { x: 100, y: 200 }, style: nodeStyles.field },
  { id: "attribution", data: { label: "attributionCon...\nType: double" }, position: { x: 300, y: 200 }, style: nodeStyles.field },
  { id: "bundleId", data: { label: "bundleId\nType: string" }, position: { x: 500, y: 200 }, style: nodeStyles.field },
  { id: "campaignId", data: { label: "campaignId\nType: long" }, position: { x: 700, y: 200 }, style: nodeStyles.field },
  { id: "clicks", data: { label: "clicks\nType: long" }, position: { x: 900, y: 200 }, style: nodeStyles.field },
  { id: "more", data: { label: "+21 more..." }, position: { x: 1100, y: 200 }, style: nodeStyles.field },

  { id: "bucket", data: { label: "Bucket 9\nData Bucket" }, position: { x: 200, y: 400 }, style: nodeStyles.bucket },
  { id: "snowflake", data: { label: "DomainHourly\nSnowflake" }, position: { x: 450, y: 400 }, style: nodeStyles.main },
  { id: "dependent", data: { label: "ImpressionFactInput\nDependent Report" }, position: { x: 700, y: 400 }, style: nodeStyles.dependent },
];

// --- Edges ---
const edges = [
  { id: "e1", source: "DomainHourly", target: "advertiserId", animated: true },
  { id: "e2", source: "DomainHourly", target: "attribution", animated: true },
  { id: "e3", source: "DomainHourly", target: "bundleId", animated: true },
  { id: "e4", source: "DomainHourly", target: "campaignId", animated: true },
  { id: "e5", source: "DomainHourly", target: "clicks", animated: true },
  { id: "e6", source: "DomainHourly", target: "more", animated: true },

  { id: "e7", source: "attribution", target: "bucket", style: { stroke: "cyan" }, animated: true },
  { id: "e8", source: "bundleId", target: "snowflake", style: { stroke: "blue" }, animated: true },
  { id: "e9", source: "campaignId", target: "dependent", style: { stroke: "magenta", strokeDasharray: "5 5" }, animated: true },
];

export default function App() {
  return (
    <div style={{ height: "100vh" }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background color="#555" gap={20} />
      </ReactFlow>
    </div>
  );
}
